os == 2) rating = 2; else if (twos == 1) rating = 1; else rating = 0; } void read(const std::string& line){ std::stringstream ss; for(size_t i = 0; i < line.size(); ++i){ if(line[i] == ' '){ bet = std::stoi(line.substr(i+1)); break; } else ss << line[i]; } hand = ss.str(); }
