} type Bingo [5][5]Box func empty_bingo() Bingo { var bingo Bingo return bingo
} func read_file(file_path string) ([]int, []Bingo) { content, err := os.ReadFile(file_path) if err != nil { log.Fatal(err) } counter := 0 var numbers []int var bingos []Bingo for _, line := range strings.Split(string(content), "\n") { if len(line) == 0 { continue } space_splited := strings.Split(line, " ") comma_splited := strings.Split(line, ",") if len(comma_splited) > 1 { for _, nbr_string := range comma_splited { nr, _ := strconv.Atoi(nbr_string) numbers = append(numbers, nr) } } else { if counter%5 == 0 { bingos = append(bingos, empty_bingo()) } j := 0 for i := 0; i < len(space_splited); i++ { if len(space_splited[i]) == 0 { continue } nr, _ := strconv.Atoi(space_splited[i]) bingos[counter/5][counter%5][j] = Box{nr, false} j++ } counter++ } } return numbers, bingos
