} func add_to_map(number_of_lines *map[[2]int]int, pos [2]int) { _, ok := (*number_of_lines)[pos] if ok { (*number_of_lines)[pos] += 1 } else { (*number_of_lines)[pos] = 1 }
} func midpoints(number_of_lines *map[[2]int]int, line Line) { diff := [2]int{line.start[0] - line.end[0], line.start[1] - line.end[1]} if diff[0] == 0 { incr := diff[1] / int(math.Abs(float64(diff[1]))) for x := line.end[1]; x != line.start[1]; x += incr { add_to_map(number_of_lines, [2]int{line.start[0], x}) } add_to_map(number_of_lines, line.start) } else if diff[1] == 0 { incr := diff[0] / int(math.Abs(float64(diff[0]))) for x := line.end[0]; x != line.start[0]; x += incr { add_to_map(number_of_lines, [2]int{x, line.start[1]}) } add_to_map(number_of_lines, line.start) } else if int(math.Abs(float64(diff[1]))) == int(math.Abs(float64(diff[0]))) { incr := [2]int{diff[0] / int(math.Abs(float64(diff[0]))), diff[1] / int(math.Abs(float64(diff[1])))} y := line.end[1] for x := line.end[0]; x != line.start[0]; x += incr[0] { add_to_map(number_of_lines, [2]int{x, y}) y += incr[1] } add_to_map(number_of_lines, line.start) }
