} // / Create a table from the input.
func tabelize(text *string) [][]string { lines := strings.Split(*text, "\n") var table [][]string for _, line := range lines { if len(line) > 0 { table = append(table, strings.Split(line, "")) } } return table
} // / Transpose the text as a matrix.
func transpose(text *string) string { var builder strings.Builder table := tabelize(text) for i := range table[0] { for j := range table { builder.WriteString(string(table[j][i])) } builder.WriteString("\n") } return builder.String()
} // / Create all diagonals of the text.
func diag(text *string) string { var builder strings.Builder table := tabelize(text) for i := len(table[0]) - 1; i >= 0; i-- { for j := 0; j+i < len(table[0]); j++ { builder.WriteString(table[j][j+i]) } builder.WriteString("\n") } for i := len(table) - 1; i > 0; i-- { for j := 0; j+i < len(table); j++ { builder.WriteString(table[i+j][j]) } builder.WriteString("\n") } return builder.String()
} // Swap the order of lines.
func swap(text *string) string { var builder strings.Builder lines := strings.Split(*text, "\n") for i := len(lines) - 1; i >= 0; i-- { builder.WriteString(lines[i]) builder.WriteString("\n") } return builder.String()
